import React,{Component} from "react";
import ProgrammersCard from "./ProgrammersCard";
class ProgrammersGrid extends Component() {
  constructor(){super();}
    
  render(){
    const info = [
      {
        id: 1,
        name: "fatima",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
        website: "http//one",
      },
      {
        id: 9,
        name: "fatten",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
      },
      {
        id: 8,
        name: "rama",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
      },
      {
        id: 7,
        name: "emma",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
        website: "http//one,",
      },
      {
        id: 3,
        name: "hya",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
        website: "http//one,",
      },
      {
        id: 2,
        name: "lora",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
      },
    ];
  
 
   members = info.map((member) => (
    <ProgrammersCard
      key={member.id}
      name={member.name}
      jop={member.jop}
      phone={member.phone}
      image={member.image}
      website={member.website}
    />
  ));
  return (
    <div className="row justify-content-md-center ms-6">
      {members}
    </div>
  );}
}
export default ProgrammersGrid;
